import React from "react";
import {Tile} from "../tile/Tile";

export const TileList = ({data}) => {

  let tileArray = [];
  data.forEach((index, info) => {
    tileArray.push(<Tile name={info.name} description={{...info}}/>)
  })

  return (
    <div>
      {tileArray}
    </div>
  );
};
